import styled from "styled-components";

const StyledButton=styled.button`
background-color:#ad5502;
border-radius:10px;
margin-top:10px;
padding:5px;
margin-right:15px;
`

const ButtonContainer=styled.div`
display:flex;
justify-content:flex-end;
`


export {StyledButton,ButtonContainer}
